//When a user successfully create's an account this will pop up
import React from 'react';
import './App.css';

const CreateAccountSuccess = () => {
    return (
        <div className="app">
            <p className="heading">Create Account Success</p>
            <div className="pageformat">
                <div className="form-content-right">
                <h4 className="form-success">We have received your request!</h4>
                </div>
            </div>
        </div>
    )

}

export default CreateAccountSuccess;
